const baseURL = url.url + "/Registry/User_Types";
const baseURL2 = url.url + "/Registry/Academic_program";
const baseURL3 = url.url + "/Registry/Document_Type";
const baseURL4 = url.url + "/Registry/create_user";

class Registro extends Component {
    state = {
        userTypesList: [],
        academicProgramsList: [],
        documentTypesList: [],
        UserType: '',
        Name: '',
        LastName: '',
        Identifier: '',
        Email: '',
        DocumentType: '',
        DocumentNumber: '',
        AcademicProgram: '',
        Password: '',
        Photo: null,
        TermAndConditions: true,
        status: false
    }

    comprobar(obj) {
        if (obj.checked)
            document.getElementById('boton').disabled = true;
        else
            document.getElementById('boton').disabled = false;
    }

    cargartiposdeusuario = () => {

        axios.get(baseURL)
            .then(response => {
                this.setState({
                    userTypesList: response.data.userTypesList,
                    status: true
                })
                console.log(response.data.userTypesList);
            })
            .catch((error) => {
                console.log(error);
            });
    }

    cargarprogramas = () => {
        axios.get(baseURL2)
            .then(response => {
                this.setState({
                    academicProgramsList: response.data.academicProgramsList,
                    status: true
                })
                //console.log(response);
            })
            .catch((error) => {
                console.log(error);
            });
    }

    cargardocumentos = () => {
        axios.get(baseURL3)
            .then(response => {
                this.setState({
                    documentTypesList: response.data.documentTypesList,
                    status: true
                })
                //console.log(response);
            })
            .catch((error) => {
                console.log(error);
            });
    }

    componentDidMount = () => {
        this.cargartiposdeusuario();
        this.cargarprogramas();
        this.cargardocumentos();

    }

    handleChange = (event) => {

        this.setState({
            UserType: document.getElementById('UserType').value,
            Name: document.getElementById('Name').value,
            LastName: document.getElementById('LastName').value,
            Identifier: document.getElementById('Identifier').value,
            Email: document.getElementById('Email').value,
            DocumentType: document.getElementById('DocumentType').value,
            DocumentNumber: document.getElementById('DocumentNumber').value,
            AcademicProgram: document.getElementById('AcademicProgram').value,
            Password: document.getElementById('Password').value

